export default function Footer(){

    return(
        <>
           <div className="footer">
               <h3>Only things which always pushes you up is your everyday learning !!
                   <br />
                   Thanks for visiting my Portfolio . If you do liked my Portfolio you can 
                   Contact me for Work...
                   <br />
                   Note : Standard rate and Charges are Applied ! , For more do contact me or mail me ..
               </h3>
              <div className="links">
                  <img src={img1} alt="" />
                  <img src={img2} alt="" />
                  <img src={img3} alt="" />
                  <img src={img4} alt="" />
              </div>
              <h4>&copy; Made by myself using React</h4>
           </div>
        </>
